Unlike your heating system, you always take your phone with you. With Clausius you can manage your heating system anytime, anywhere.

To use Clausius you need one of a supported Seltron heating controllers and GWD communication module that connects the controller to the internet. 

Test the app with a virtual device before purchase!

Currently supported Seltron controller series are: PROMATIC WDC, WXD, KXD, SGC and KUD. We’re actively working on support also for the other controllers. 

Using Clausius you can:
- set a day and night temperatre and operating mode;
- set up to 2 different heating schedules for each heating area in your building;
- set Party, Eco, Holiday and Heat Once user functions;
- invite family members and friends to use Clausius;
- see how much energy you gained from your solar panels and pellet boliers;
- see pellet levels in your pellet boiler compartment so you never miss loading them before they burn out;
- see alerts and notifications from your controller;
- rename heating areas in your building;
- see temperatures and relay statuses in your heating system. 

Starting this fall you will be able to connect with your heating system contractor through the Clausius app. They will be able to solve some issues remotely and help you with troubleshooting. If the issue will not be possible to solve remotely, your heating system contractor will come to you prepared with the right tools and equipment.
